import SeatElement from "../Elements/SeatElement";
function SeatsPanel(props) {
    return (
      <div>
        {props.TrainManager.getCurrentTrain().seats.map((seat, index) => (
          <SeatElement Seat={seat}/>
        ))}
      </div>
    );
  }
  
export default SeatsPanel;
